$(document).ready(function(){pages.init()});var pages={init:function(){this.create_form();this.create_page()},create_form:function(){this.create_page_form=new formular("#create_page",function(b){if(b.status==="hitted"&&b.action==="submit"){var a={};$.each($("#create_page form").serializeArray(),function(c,d){a[d.name]=d.value});index.sdk.api.post($("#create_page form").attr("action"),a,function(c){})}});this.create_page_form.init();this.edit_page_form=new formular("#edit_page",function(b){if(b.status==="hitted"){switch(b.action){case"submit":var a=pages.edit_page_form.get_datas();index.sdk.api.put($("#edit_page form").attr("action"),a,function(c){});break;case"delete":var a={};index.sdk.api.deleting($("#edit_page form").attr("action"),{_id:$("#edit_page form").attr("data-id")},function(c){console.log(c)});break}}});this.edit_page_form.init()},create_page:function(){if(typeof pager==="undefined"){return false}this.pager=new pager();this.pager.init($("#pager_interface"),function(a){console.log(a)})}};